(147, 'GL 657 Touch', '<h4>Features</h4>\r\n<ul>\r\n    <li>Grill</li>\r\n    <li>Top heating+convection</li>\r\n    <li>Back heating+convection</li>\r\n    <li>Grill+Top heating</li>\r\n    <li>Grill+Top heating+Convection</li>\r\n    <li>Top Bottom heating+Convection</li>\r\n    <li>Top+Bottom heating</li>\r\n    <li>Bottom heating+Convection</li>\r\n    <li>Large viewing window</li>\r\n    <li>Double glass door</li>\r\n    <li>Oven light, child safety lock</li>\r\n    <li>Large oven capacity - 56L</li>\r\n    <li>Timer 24 hours</li>\r\n    <li>Grill plate, grill shelf,oil collect plate</li>\r\n    <li>Convection oven with turbo fan</li>\r\n    <li>Dimensions (W x D x H) 595 x 568 x 596 mm</li>\r\n    <li>Opening (W1 x D1 X H1) 565 x 575 x 592 mm</li>\r\n</ul>', 193, 'GL 657 Touch', -1.00, 0.00, 40, 5, '2014-03-21 06:25:03', '2014-03-21 06:25:03', NULL),
(148, 'GL 658 Touch', '<h4>Features</h4>\r\n<ul>\r\n    <li>Grill</li>\r\n    <li>Top heating+convection</li>\r\n    <li>Back heating+convection</li>\r\n    <li>Grill+Top heating</li>\r\n    <li>Grill+Top heating+Convection</li>\r\n    <li>Top Bottom heating+Convection</li>\r\n    <li>Top+Bottom heating</li>\r\n    <li>Bottom heating+Convection</li>\r\n    <li>Large viewing window</li>\r\n</ul>\r\n      ', 194, 'GL 658 Touch', -1.00, 0.00, 40, 6, '2014-03-21 06:28:58', '2014-03-21 06:28:58', NULL),
(149, 'GL 672 Touch', '<h4>Features</h4>\r\n<ul>\r\n    <li>Microwave</li>\r\n    <li>Defrost</li>\r\n    <li>Combi</li>\r\n    <li>Grill</li>\r\n    <li>Auto cook</li>\r\n    <li>Large oven capacity</li>\r\n    <li>Preset auto cook menu</li>\r\n    <li>Defrost by time and weight</li>\r\n    <li>Auto defrost</li>\r\n    <li>Touch control</li>\r\n</ul>', 195, 'GL 672 Touch', -1.00, 0.00, 41, 1, '2014-03-21 06:38:45', '2014-03-21 06:38:45', NULL),
(150, 'GL 6073 SS', '<p class=\\"desc\\">\r\n  A sleek new artistic chimney with the perfect interplay of glass and steel\r\n</p>\r\n<h4>Features</h4>\r\n<ul>\r\n    <li>Touch control with timer</li>\r\n    <li>SS clad aluminum filter</li>\r\n    <li>FRP housing</li>\r\n    <li>2 energy saving 2 W LED lamps</li>\r\n</ul>\r\n\r\n<h4>Performance</h4>\r\n<ul>\r\n  <li>Airflow  1000 m<sup>3</sup>/hr</li>\r\n</ul>', 196, 'GL 6073 SS', 29990.00, 0.00, 27, 45, '2014-03-21 08:02:56', '2014-03-21 08:02:56', NULL),
(151, 'GL 7011 9 Fin', '<h4>Features</h4>\r\n<ul>\r\n    <li>Environment friendly conducting oil</li>\r\n    <li>Turbo Fan- For\r\nQuick Heating</li>\r\n    <li>Thermostat- To control Room\r\nTemperature</li>\r\n    <li>Overheating protection </li>\r\n    <li>In-built handle\r\n& castor wheels </li>\r\n    <li>3 Power levels </li>\r\n    <li>Power 9/11 fins2000\r\n+ 400 W 13 fins 2500 + 400 W </li>\r\n</ul>\r\n\r\n\r\n\r\n<table style=\\\\\\''width:100%\\\\\\''>\r\n    <tbody>\r\n    <tr>\r\n        <td colspan=\\\\\\''2\\\\\\''>Variant(s)</td>\r\n    </tr>\r\n    <tr>\r\n        <td class=\\\\\\''left-align\\\\\\''>7011 Glen Oil Radiator Heater 11 Fins\r\n</td>\r\n        <td class=\\\\\\''right-align\\\\\\''>₹ 10990\r\n</td>\r\n    </tr>\r\n    <tr>\r\n        <td class=\\\\\\''left-align\\\\\\''>7011 Glen Oil Radiator Heater 13 Fins\r\n</td>\r\n        <td class=\\\\\\''right-align\\\\\\''>₹ 11990\r\n</td>\r\n    </tr>\r\n     \r\n    </tbody>\r\n</table>                ', 19, 'GL 7011 9 Fin', 9990.00, 0.00, 5, 1, '2014-03-21 08:14:30', '2014-03-21 08:14:56', NULL),
(152, 'GL 7013', '<h4>Features</h4>\r\n<ul>\r\n    <li>Energy efficient PTC heating</li>\r\n    <li>Cool/warm/hot air selection</li>\r\n    <li>Thermostat - to control room\r\ntemperature</li>\r\n    <li>Overheating protection </li>\r\n    <li>90 degree left & right rotation base </li>\r\n   <li>1000/1800 W</li>\r\n   <li>2 POWER SETTINGS</li>\r\n    \r\n</ul>', 197, 'GL 7013', 4990.00, 0.00, 6, 3, '2014-03-21 08:30:51', '2014-03-21 08:30:51', NULL),
(153, 'GL 7012', '<h4>Features</h4>\r\n<ul>\r\n    <li>Automatic oscillation radius 70\r\ndegrees</li>\r\n    <li>LED digital display</li>\r\n    <li>Multifunction\r\nremote control</li>\r\n    <li>Safety tip-over\r\nswitch </li>\r\n    <li>Energy efficient PTC\r\nheating </li>\r\n   <li>0.5 to 7.5 hours timer</li>\r\n   <li>Thermostat- To control Room Temperature</li>\r\n<li>Overheating protection</li>\r\n<li>Recessed carry handle</li>\r\n<li>1000/1800 W</li>\r\n<li>2 power settings</li>\r\n    \r\n</ul>                ', 198, 'GL 7012', 9990.00, 0.00, 6, 2, '2014-03-21 09:01:25', '2014-03-21 09:02:01', NULL),
(154, 'GL 2023 PLTR', '<h4>Features</h4>\r\n<ul><li>Top lid - Toughened glass</li>\r\n<li>Gas grill, gas oven </li>\r\n<li>Italian\r\nthermostat for single knob oven\r\noperation (GL 2012PLTR) </li>\r\n<li>Gas grill, electric oven\r\n(GL 2023/24PLTR AI)</li>\r\n<li>Oven light, timer with hold\r\nfacility (GL 2023/24PLTR AI)</li>\r\n<li>Auto Ignition - top burners\r\n(AI model)</li>\r\n<li> Motorised Rotisserie (optional)</li>\r\n</ul>                \r\n\r\n<h4>Cooking output</h4>\r\n<ul>\r\n  <li>Triple-ring burner </li>\r\n  <li> Alloy burners (GL 2012/23PLTR) </li>\r\n  <li> Alloy burners & 1 hot plate\r\n(GL 2024PLTR AI) </li>\r\n</ul>\r\n\r\n<table style=\\''width:100%\\''>\r\n<tbody>\r\n<tr>\r\n<td colspan=\\''2\\''>Variant(s)</td>\r\n    </tr>\r\n    <tr>\r\n        <td class=\\''left-align\\''>Cooking Range 2023 PL TR AI\r\n\r\n\r\n</td>\r\n        <td class=\\''right-align\\''>₹ 34990\r\n\r\n\r\n</td>\r\n    </tr>\r\n    </tbody>\r\n</table>           ', 6, 'GL 2023 PLTR', 33990.00, 0.00, 3, 5, '2014-03-21 10:17:56', '2014-03-21 10:17:56', NULL),
(155, 'GL 2024 PLTR', '<h4>Features</h4>\r\n<ul><li>Top lid - Toughened glass</li>\r\n<li>Gas grill, gas oven </li>\r\n<li>Italian\r\nthermostat for single knob oven\r\noperation (GL 2012PLTR) </li>\r\n<li>Gas grill, electric oven\r\n(GL 2023/24PLTR AI)</li>\r\n<li>Oven light, timer with hold\r\nfacility (GL 2023/24PLTR AI)</li>\r\n<li>Auto Ignition - top burners\r\n(AI model)</li>\r\n<li> Motorised Rotisserie (optional)</li>\r\n</ul>                \r\n\r\n<h4>Cooking output</h4>\r\n<ul>\r\n  <li>Triple-ring burner </li>\r\n  <li> Alloy burners (GL 2012/23PLTR) </li>\r\n  <li> Alloy burners & 1 hot plate\r\n(GL 2024PLTR AI) </li>\r\n</ul>\r\n\r\n<table style=\\''width:100%\\''>\r\n<tbody>\r\n<tr>\r\n<td colspan=\\''2\\''>Variant(s)</td>\r\n    </tr>\r\n    <tr>\r\n        <td class=\\''left-align\\''>Cooking Range 2024 PL TR AI\r\n\r\n</td>\r\n        <td class=\\''right-align\\''>₹ 34990\r\n\r\n</td>\r\n    </tr>\r\n    </tbody>\r\n</table>      ', 7, 'GL 2024 PLTR', 33990.00, 0.00, 3, 6, '2014-03-21 10:22:15', '2014-03-21 10:22:15', NULL);
